import React from "react";
import "../../App.css";

export default function Products() {
  return (
    <div className="products">
      <div className="pages-container">
        <div>Our website is under revamping</div>
        <div className="contact-info">
          <div>Contact US</div>
          <div className="tel-info contact-detail">Tel: 21857010</div>
          <div className="fax-info contact-detail">Fax: 39091597</div>
          <div className="email-info contact-detail">Email: info@hacson.hk</div>
        </div>
      </div>
    </div>
  );
}
